import './App.css';
import Navbar from "./components/navbar.js";
import About from "./sections/about.js";
import Timeline from "./sections/timeline.js";
import Skills from "./sections/skills.js";

function App() {
  return (
    <>
    <body>
      <Navbar></Navbar>
      <About></About>
      <Timeline></Timeline>
      <Skills></Skills>
    </body>
    </>
  );
}

export default App;
